description:
The latest single from comedian/radio personality and former child actor. Duran continues to express his artistic integrity in the form of this reggae-fused number. Taken from his upcoming release &quot;Live at the Whisky Au Go Go&quot;. For over 20 years Duran has remained an underground king, free to create as wild and mindless as he wishes. 


1. &quot;Born Refugee&quot; (Written By Jeff Dandurand)


From The Upcoming CD &quot;Live At The Whisky Au Go Go&quot;
